import React from "react";
import { Container, Row, Col, Card } from "react-bootstrap";

const HomePage = () => {
  const sampleData = [
    {
      id: "001",
      vehicleType: "Volkswagen ID.4",
      location: "Dublin",
      availability: "Available"
    },
    {
      id: "002",
      vehicleType: "Tesla Model 3",
      location: "Cork",
      availability: "Booked"
    },
    {
      id: "003",
      vehicleType: "Nissan Leaf",
      location: "Galway",
      availability: "Available"
    }
  ];

  return (
    <Container className="mt-5">
      <h1 className="text-center mb-4">Welcome to Nevo Test Drive Service</h1>
      <Row>
        {sampleData.map((vehicle) => (
          <Col md={4} key={vehicle.id} className="mb-4">
            <Card>
              <Card.Body>
                <Card.Title>{vehicle.vehicleType}</Card.Title>
                <Card.Text>
                  Location: {vehicle.location}
                  <br />
                  Availability: {vehicle.availability}
                </Card.Text>
              </Card.Body>
            </Card>
          </Col>
        ))}
      </Row>
    </Container>
  );
};

export default HomePage;
